er of tasks: 2393 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 115.60 s &lt;/li&gt;\n&lt;li&gt; deserialize time: 47.91 s &lt;/li&gt;\n&lt;li&gt; transfer time: 820.55 ms &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://172.21.0.161:8786 &lt;/li&gt;\n          &lt;li&gt; Workers: 64 &lt;/li&gt;\n          &lt;li&gt; Threads: 1536 &lt;/li&gt;\n          &lt;li&gt; Memory: 10.80 TiB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.11.2 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 0+unknown &lt;/li&gt;\n        &lt;/ul&gt;\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\nimport yaml\nfrom dask_interface import Initialization\nimport dask\nimport dask.array as da\nfrom dask.distributed import performance_report\nimport time\n\ndef Derivee(F, dx, periodic=0):\n    \"\"\"\n    First Derivative\n       Input: F        = function to be derivate\n              dx       = step of the variable for derivative\n              periodic = 1 if F is periodic\n       Output: dFdx = first derivative of F\n    \"\"\"\n    nx   = len(F)\n    #dFdx = 0. * F\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3:nx - 1] - F[1:nx - 3] - (F[4:nx] - F[0:nx - 4]) / 8.)\n    return dFdx\n\n# Get configuration\nwith open(r'config.yml') as file:\n    data = yaml.load(file, Loader=yaml.FullLoader)\n    Sworkers = data[\"workers\"]\n\n# Scheduler file name \nscheduler_info = 'scheduler.json'\n\n# Initialize the Deisa Adaptor \nAdaptor = Initialization(Sworkers, scheduler_info)\n\n# Check if client version is compatible with scheduler version\nAdaptor.client.get_versions(check=True)\n\n# Get data descriptor as a dict of Dask arrays\narrays = Adaptor.get_data()\n\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n   t = time.time()\n   # Get the Dask array global_t\n   gt = arrays[\"global_t\"]    \n   #gt = gt.rechunk({0: 1})\n   #print(gt.chunks)\n   # Construct a lazy task graph \n   der = Derivee(gt[::2], 1) \n   cpt =  da.linalg.norm(der, axis=(1,2))\n\n   # Submit the task graph to the scheduler\n   s = Adaptor.client.compute(cpt)\n   # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it.  \n   print(s.result(), flush=True)\n\nprint(\"Done in \", time.time() -t, \"secondes\")\nAdaptor.client.shutdown()\n\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1558","type":"MonthsTicker"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1520","type":"MonthsTicker"},{"attributes":{"base":24,"mantissas":[1,2,4,6,8,12],"max_interval":43200000.0,"min_interval":3600000.0,"num_minor_ticks":0},"id":"1514","type":"AdaptiveTicker"},{"attributes":{},"id":"1448","type":"AllLabels"},{"attributes":{},"id":"1523","type":"YearsTicker"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1031","type":"Quad"},{"attributes":{},"id":"1524","type":"UnionRenderers"},{"attributes":{"months":[0,4,8]},"id":"1535","type":"MonthsTicker"},{"attributes":{"mantissas":[1,2,5],"max_interval":500.0,"num_minor_ticks":0},"id":"1550","type":"AdaptiveTicker"},{"attributes":{},"id":"1006","type":"DataRange1d"},{"attributes":{"months":[0,6]},"id":"1522","type":"MonthsTicker"},{"attributes":{"months":[0,2,4,6,8,10]},"id":"1534","type":"MonthsTicker"},{"attributes":{"months":[0,6]},"id":"1536","type":"MonthsTicker"},{"attributes":{"base":60,"mantissas":[1,2,5,10,15,20,30],"max_interval":1800000.0,"min_interval":1000.0,"num_minor_ticks":0},"id":"1513","type":"AdaptiveTicker"},{"attributes":{},"id":"1497","type":"UnionRenderers"},{"attributes":{"days":[1,8,15,22]},"id":"1531","type":"DaysTicker"},{"attributes":{"days":[1,15]},"id":
